import React, { useState } from 'react'
const Statistics = (props) => {
  if (props.count === 0) {
    return (
      <div>
        <p>No Feedback given</p>
      </div>
    )
  } else {
    return (
      <div>
        <p>{props.text} {props.count}</p>
      </div>
    )
  }
}
const Sum = (props) => {
  let sum = 0;
  for (let i = 0; i < props.length; i++) {
      sum += props[i];
    }
  return (
    <p>{sum}</p>
  )
}

